export function Player({characterName, player, level, clazz, race, killStats}) {
    this.characterName = characterName;
    this.player = player;
    this.level = level;
    this.clazz = clazz;
    this.race = race;
    this.killStats = killStats;

    // Object.defineProperty(this, "totalKills", {
    //     get: function() {
    //         return this.killStats.reduce((accumulator, current) =>
    //             accumulator + current.count, 0)
    //     }
    // });
}

Player.prototype.totalKills = {
    get: function() {
        return this.killStats.reduce((accumulator, current) =>
        accumulator + current.count, 0);
    }
}
function Person(firstName, lastName) {
    this.firstName = firstName;
    this.lastName = lastName;
}

Person.prototype.fullName = {
    get: function() {
    return `${this.firstName} ${this.lastName}`;
}
};

const simon = new Person("simon", "aust");
console.log(simon.fullName)

const person = new Person('Jane', 'Smith');
console.log(person.fullName); // Output: Jane Smith
export const TEST_PLAYERS = [
