            {id: 2, type: "ogre", count: 1}]
    },
    {name: "Spock", player: "Leonard", level: 89, clazz: "Wizard", race: "Vulcan",
        killStats: [
            {id: 0, type: "goblin", count: 4},
            {id: 1, type: "orc", count: 2},
            {id: 2, type: "ogre", count: 1}]
    },
    {name: "Batman", player: "Bruce", level: 999, clazz: "Ninja", race: "Human",
        killStats: [
            {id: 0, type: "goblin", count: 4},
            {id: 1, type: "orc", count: 2},
            {id: 2, type: "ogre", count: 1}]
    }
];

